import React from "react";
import { useRouter } from "next/router";

const ViewPost = ({ postid }) => {
  //   const { postid } = useRouter().query;

  return <div>{postid}</div>;
};

export default ViewPost;

ViewPost.getInitialProps = async ({ query: { postid } }) => {
  return { postid };
};
